import { useEffect } from "react";
import {getAllCopmanies} from '../Redux/Companies/CompaniesThunk'
import { useDispatch, useSelector } from 'react-redux';
import { MDBTable, MDBTableBody, MDBTableHead } from 'mdbreact';

 import { useState } from "react";
  
export default function ShowCompanies() {
 
  const dispatch = useDispatch();
  let [c,setC]=useState([]);

  useEffect(async () => {
    

    let myAllCopmanies = await getAllCopmanies(dispatch);
    await console.log(myAllCopmanies)
    await setC(myAllCopmanies)
    
      }, [])
     return<>
     
     <h2>חברות</h2>
    <MDBTable responsive>

     <MDBTableHead>
        <tr>
        <th>סיסמא</th>
        <th>שם משתמש</th>
        <th> סיסמת מייל שירות לקוחות</th>
        <th> מייל שירות לקוחות</th>
        <th>מייל פרטי</th>
        <th>שם חברה</th>
          
          
          
        
          
          
          
        </tr>
      </MDBTableHead>
     
     {

      c != undefined ?
      c.length > 0 &&
      c.map((item) =>
           
      
      <MDBTableBody>
          <td>{item.userPassword}</td>
          <td>{item.userName}</td>
          <td>{item.customerServiceEmailPassword}</td>
          <td>{item.customerServiceEmail}</td>
          <td>{item.privateEmail}</td>
          <td>{item.nameCompany}</td>
      </MDBTableBody>
   
           
      )   
         : <div>אין חברות</div>
 
     }  </MDBTable>

   </>
   
 }
